def generate_fibonacci(n):
    fibonacci = []
    (a, b, c) = (0, 1, 1)
    while len(fibonacci) <= n:
        if c % 3 != 0 and c % 5 != 0:
            fibonacci.append(c)
        (a, b, c) = (b, c, b + c)
    return fibonacci

